import React from 'react';

function RoataCuloriNatura() {
    const size = 200; // Diametrul cercului în pixeli
    return (
        <svg width={size} height={size} viewBox="0 0 100 100">
            {/* Roșu */}
            <path
                d="M 50,50 L 100,50 A 50,50 0 0 1 50,100 L 50,50"
                fill="red"
            />
            {/* Galben */}
            <path
                d="M 50,50 L 50,100 A 50,50 0 0 1 0,50 L 50,50"
                fill="yellow"
            />
            {/* Albastru */}
            <path
                d="M 50,50 L 0,50 A 50,50 0 0 1 50,0 L 50,50"
                fill="blue"
            />
        </svg>
    );
}

export default RoataCuloriNatura;
